  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas dataset describes the
  percentage of each block group that is classified as impervious, forest, green space,
  wetland, and agriculture. Impervious is a combination of dark and light impervious.
  Forest is a combination of trees and forest and woody wetlands. Green space is a
  combination of trees and forest, grass and herbaceous, agriculture, woody wetlands,
  and emergent wetlands. Wetlands includes both Woody and Emergent Wetlands.This dataset
  was produced by the US EPA to support research and online mapping activities related
  to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to
  interact with a web-based, easy-to-use, mapping application to view and analyze
  multiple ecosystem services for the contiguous United States. The dataset is available
  as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an
  EnviroAtlas map service. Additional descriptive information about each attribute
  in this dataset can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
